            <text fill="black" xml:space="preserve" style="white-space: pre" font-family="Inter" font-size="4" font-weight="300" letter-spacing="0em"><tspan x="57" y="336.955">Kirsten is a researcher and Ph.D. in particle physics, whose parents were </tspan><tspan x="57" y="341.955">aerospace engineers that passed away in a test flight accident. &#10;</tspan><tspan x="57" y="346.955">&#10;</tspan><tspan x="57" y="351.955">&#10;</tspan><tspan x="57" y="356.955">As she grew up and pursued a career in science, she grew dissatisfied </tspan><tspan x="57" y="361.955">with how Columbian science only cared about money or power rather </tspan><tspan x="57" y="366.955">than actual scientific advancement. &#10;</tspan><tspan x="57" y="371.955">&#10;</tspan><tspan x="57" y="376.955">&#10;</tspan><tspan x="57" y="381.955">With that in mind, she proposed to her associate Saria her idea to create </tspan><tspan x="57" y="386.955">a company dedicated solely to scientific advancement.</tspan></text>
